import React from 'react';
import ProgressBar from 'react-bootstrap/ProgressBar';
class Tutorialscore extends React.Component{
    constructor(props){
        super(props);
        this.state=props;
        console.log(this.state)
    }
    render(){
        return(
               <div>{this.state.tutorial_name}<ProgressBar><ProgressBar animated variant="success"  now={40} label={"40%"} key={1}/><ProgressBar animated variant="danger" now={20} key={2} label={"20%"}/></ProgressBar></div>
        )
    }
}
export default Tutorialscore;
